Though we moved into this house a year ago, this felt like the true homecoming. To be able fill our home with music, poetry and love with none other than Prahaladji — is a true privilege.

And it all began with an intention — a seed that Bindhu and I sowed at the beginning of the year. Bindu and I carried a quiet, heartfelt desire — to bring Prahaladji to Bangalore - not just to host an event or a workshop, but for this city, our friends, and extended community to meet our Prahaladji — the Prahaldji we have experienced: who doesn’t just sing Kabir, but becomes a vessel of Kabir. 

The seed bore fruit and magic happened! The space came alive in the most soulful way. For 3 days it was home to over 30 people some of whom had met and others never, all tied together by Kabir’s poetry and Prahaladji's presence. We sang together, ate, laughed,  shared and connected. The energy was indescribable - pure, alive, unforgettable. I get goosebumps thinking about it! 

Deeply indebted to Prahaldji, Ajay bhaiyya, Devkaka, Dharmender bhaiyya, and my two lovely brothers Jonty and Monty for blessing our home and hearts ❤️
I do not want to thank you Bindhu, I want to give you tight hugs 🥺😍🤗🤗❤️

And while we were all immersed in the music and poetry my dear friend Akila was also capturing it in her lens! 😍😍 Only you 🤗

